import React from 'react';
import { HeaderContainer, Icon, Links, LinkItem } from './HeaderStyles';
import ImageIcon from './ImageIcon';

const Header = () => {
  return (
    <HeaderContainer>
      <Icon><ImageIcon /></Icon>
      <Links>
        <LinkItem href="/projects">project</LinkItem>
        <LinkItem href="/thoughts">thoughts</LinkItem>
      </Links>
    </HeaderContainer>
  );
};

export default Header;
